import React from 'react';


function Prstest(props){
    return (
        <div className='mt-5 col-md-4 col-sm-6 border text-center'>
            <div className='card'>
                <div>
                    
                </div>
            </div>
           <h5 >{props.nom}</h5>  
           <p>{props.travail}</p>
           <p>{props.email}</p>
           <p>{props.telephone}</p>
             
        </div>
    );
}

export default Prstest;
